//   ];

  const [images, setImages] = useState();

  useEffect(() => {
    setImages(
      Array.from(Array(10).keys()).map((id) => ({
        id,
        url: `https://picsum.photos/1000?random=${id}`
      }))
    );
  }, []);

  return (
    <div className={s.App}>
      <ImageCarousel images={images} />
    </div>
  );
};

export default Slide;
